import 'bootswatch/dist/superhero/bootstrap.min.css'

const initialState = 0

const reducer = (state, action) => {
    switch (action.type) {
        case 'A':
            return state + 1
        case 'B':
            return  state - 1
        default:
            return state
    }
}



let state = reducer(initialState, { type: 'A' })
console.log(state)
